import { Link } from 'react-router-dom';
import "../Styles/Navbar.css"
export default function Navbar(){
    return (
        <div className="navbar">
            <p>wholesaler</p>
             <Link to="/">Home</Link>
             <Link to="/profile">Profile</Link>
             <Link to="/dashboard">Dashboard</Link>
        </div>
    )
}
